import React from 'react';
import PropTypes from 'prop-types';
import './QuestionSummaryItem.css';

const questionSummaryItem = props => {
    return (
        <div className="QuestionItem" onClick={() => props.onQuestionSelected(props.id)}>
            <div className="QuestionItemText">
                <p className="QuestionParagraph">{props.question}</p>
            </div>
            <div className="QuestionItemAnswers">
                {props.answers} <br></br>
                <p className="AnswersParagraph">respostas</p>
            </div>
        </div>
    );
};

questionSummaryItem.propTypes = {
    onQuestionSelected: PropTypes.func,
    question: PropTypes.string,
    answers: PropTypes.number,
    id: PropTypes.number,
    key: PropTypes.string
}

export default questionSummaryItem;
